const Login: React.FC = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
      }}
    >
      <img src="/RottenMods.png" alt="RottenMods Logo" width="500" />
      <p>Login</p>
    </div>
  );
};

export default Login;
